import React from "react"

class HomePage extends React.Component {
    state = {
      loading: false
    }

    componentDidMount() {
        this.setState({ loading: true })
    }

    render(){
        return(
            <>
                <div className="homeMainContainer">
                    <div className="innerContainer">
                        <span className={this.state.loading? "homeMainSpan":"homeMainSpanAway"}>Get your <span className="homeChangeGameSpan">Minecraft</span> server from U1Servers</span>
                    </div>
                </div>
            </>
        )
    }
}

export default HomePage
